import React from 'react'
import StatList from './StatList'

function StatViewer() {
    const stats = {
        'Название1': 0,
        'Название2': 0,
        'Название3': 0,
        'Название4': 0,
        'Название5': 0,
    }

  return (
    <div className='StatViewer'>
        <div>Селектор</div>
        <StatList stats={stats}/>
    </div>
  )
}

export default StatViewer
